syntax = "proto2";

message Row_RoundDialog
{
    optional string key = 1;
    optional int32 clickEnterNext = 2;
    optional int32 speaker = 3;
    optional int32 dialogUIType = 4;
    optional string chinese = 5;
    optional string japan = 6;
}

message Table_RoundDialog
{
    repeated Row_RoundDialog datas = 1;
}